svg.script:


function onMouseOverLabel_strictplus(evt) { 
    var Line_strictplus = document.getElementById(evt.target.id.replace("Label_strictplus", "Line_strictplus")); 
    Line_strictplus.setAttribute("style", "fill:none;stroke:black;stroke-width:3"); 
    evt.target.setAttribute("font-size", 17); 
} 
function onMouseOutLabel_strictplus(evt) { 
    var Line_strictplus = document.getElementById(evt.target.id.replace("Label_strictplus", "Line_strictplus")); 
    Line_strictplus.setAttribute("style", "fill:none;stroke:black;stroke-width:1"); 
    evt.target.setAttribute("font-size", 15); 
} 
function onMouseOverLine_strictplus(evt) { 
    var Label_strictplus = document.getElementById(evt.target.id.replace("Line_strictplus", "Label_strictplus")); 
    evt.target.setAttribute("style", "fill:none;stroke:black;stroke-width:3"); 
    Label_strictplus.setAttribute("font-size", 17); 
} 
function onMouseOutLine_strictplus(evt) { 
    var Label_strictplus = document.getElementById(evt.target.id.replace("Line_strictplus", "Label_strictplus")); 
    evt.target.setAttribute("style", "fill:none;stroke:black;stroke-width:1"); 
    Label_strictplus.setAttribute("font-size", 15); 
}
